import React from 'react'
import { connect } from 'react-redux'
import './Card.css'

class Card extends React.Component {
  render() {
    return(
      <div className='card'>
        <img src={`./images/${this.props.card.name.toLowerCase()}.png`} alt={this.props.card.name} />
      </div>
    )
  }
}

export default connect()(Card)
